import { Card, Input } from "antd";
import { useInput } from "../../components/CustomHooks";
import { CentralAppLayout } from "../../components/";

const ParkingRegist = () => {
  const { plateNumber, onChangePlateNumber } = useInput();

  return (
    <CentralAppLayout>
      <Card title={차량등록}>
        <Form.Item
          name="plateNumber"
          label="차량번호"
          rules={[
            {
              required: true,
              message: "이메일를 입력해 주세요!",
            },
          ]}
        >
          <Input
            value={plateNumber}
            onChange={onChangePlateNumber}
            placeholder="차량번호를 입력해주세요"
          />
        </Form.Item>
      </Card>
    </CentralAppLayout>
  );
};

export default ParkingRegist;
